"use strict";
exports.createDefaultTodosState = function () {
    return {
        editedTodo: exports.createDefaultTodo(),
        todos: [
            { id: 1, name: "First TODO...", isDone: true },
            { id: 2, name: "Second TODO...", isDone: false }
        ]
    };
};
exports.createDefaultTodo = function () {
    return { id: 0, name: "", isDone: false };
};
